<script setup>


import { endpoints } from "../common/endpoints";
import { axios } from "../common/api.service";
import { ref, onMounted } from "vue";
import html2pdf from "html2pdf.js";
import { useDateFormatted } from "../use/useDateFormatted";

const order_smt_ref = ref({});
const order_verify_ref = ref({});
const order_test_ref = ref({});
const order_shipping_ref = ref({});
const order_info = ref({});



const showForm = ref(false);
const isLoading = ref(false);


const props = defineProps({
  uuid: String,
});



async function callApi() {
  const endpoint = `${endpoints["production"]}${props.uuid}/`;

  try {
    const response = await axios.get(endpoint);

    const { order_smt,  order_verify, order_test, order_shipping } = response.data

    order_shipping_ref.value = order_shipping;
    order_smt_ref.value = order_smt;
    order_verify_ref.value = order_verify;
    order_test_ref.value = order_test;
    order_info.value = response.data

    console.log(order_smt_ref.value);
    isLoading.value = true

  } catch (error) {
    alert(error);
  }
}






 function printContent () {
      // Pass the element id here
      html2pdf(document.getElementById("printable-content"), {
			margin: 2,
  			filename: "foglio di caratterizzazione.pdf",
			});
    }

// lifecycle hooks
onMounted(() => {
  callApi();

});
</script>
